def compare_list(left, right, left_name, right_name):
    missing = 0
    for index, sym in enumerate(left):
        if sym not in right:
            print(index, sym, 'missing in', right_name)
            missing += 1
    print(f'{left_name}: total of {missing} missing in {right_name}')

